import sys
sys.setrecursionlimit(50000)

def high_substr_rec(str1, str2, i, j, memo):
    if i == len(str1) or j == len(str2):
        return 0

    if (i, j) in memo:
        return memo[(i, j)]

    skip_str1_letter = high_substr_rec(str1, str2, i+1, j, memo)
    skip_str2_letter = high_substr_rec(str1, str2, i, j+1, memo)
    process_both_letters = 0
    if str1[i] == str2[j]:
        process_both_letters = high_substr_rec(str1, str2, i+1, j+1, memo) + 1

    memo[(i, j)] = max(skip_str1_letter, skip_str2_letter, process_both_letters)

    return memo[(i, j)]


def high_substr(str1, str2):
    memo = {}
    return high_substr_rec(str1, str2, 0, 0, memo)


print(high_substr("a", "a"))
print(high_substr("hna", "hna"))
print(high_substr("abdcc", "abcde"))
